const type="SERVICES_CONTENT_DATA_SUCCESS"
export function servicesContentDataSuccess(services) {
    return {
        type: type,
        payload: services
    }
}

export const servicesContentData = (url) => dispatch => {
    fetch(url)
        .then(
            response => {
                if (!response.ok) {
                    throw new Error(response.statusText)
                }
                return response
            })
        .then(response => response.json())
        .then(services => dispatch(servicesContentDataSuccess(services)))
}
